import React from 'react'

export const GifExpertApp = () => {

    let anime = ['Demon Slayer', 'Tokyo Revenger', 'Dangaropa', 'Naruto']


    return (
        <>
            <h2>GifExpertApp</h2>
            <hr/>
            <ol>
                {
                    anime.map( an => {
                        return <li key={ an } > an </li>
                    } )
                }
            </ol>
        </>
    )
}
